"use strict";

Component({
  mixins: [],
  data: {
    $uiName: 'checkbox'
  },
  props: {
    className: '',
    isChecked: false,
    size: 44,
    disabled: false,
    onDmChange: function onDmChange() {}
  },
  didMount: function didMount() {},
  didUpdate: function didUpdate() {},
  didUnmount: function didUnmount() {},
  methods: {
    onDmChange: function onDmChange(e) {
      if (this.props.disabled) {
        return;
      }

      this.props.onDmChange(e, this);
    }
  }
});